const RelatedVideo = () => {
    const [recommandedVideos,setRecommondedVideos]=useState([]);
    useEffect(()=> getchannel(),[])
let video=[];
    const getchannel=()=>{
         fetch("https://youtubeclonee.herokuapp.com/channel/getvideos",
        {method:"GET",})
        .then((data)=>data.json())
        .then((res)=>{
            // console.log(res)
            setRecommondedVideos(res)
            
        });
               
      }
    return (
        <div className="RelatedVideo">

        {recommandedVideos.map((v,index)=>(
            <RelatedVideoRow
            key={index}
            id={v.video._id}

            title={v.video.title}
            channel={v.channelName}
            image1={v.video.imageLink}
            videoLink={v.video.videoLink}
            image2={v.logo}
            timestamp={v.video.timestamp}
            views={v.video.views}
            
            />
    ))}
        
       
        </div>
    )
}


function RelatedVideoRow({
    title,
    channel,
    image1,
    image2,
    timestamp,
    views,
    description,
    id,
    videoLink

}){
    let temp=timestamp.split(" ");
        let date="";
        if(temp.length>3)
        {
        date=temp[1]+" "+temp[2]+","+temp[3];
        }
        else{
        date=timestamp;
        }
    const history=useHistory();
    const [view,setView]=useState(views)
    const [hover,setHover]=useState(false);
    const viewUpdate=(title,channelName)=>{
        // console.log(id,channelName)
        const updateOn={
             title:title,
            channelName:channel,
            
        }
            fetch("https://youtubeclonee.herokuapp.com/channel/updateview",
            {
                method:"PUT",
                body: JSON.stringify(updateOn),
                headers:{"Content-Type":"application/json"},
            }).then((res)=>{
                if(res.status==200)
                {
                    setView(view+1)
                }
                
            }).catch((e)=> console.log("ERROR"))  
        
    }
    return(
        <div className="RelatedVideoRow" onClick={()=>{
            viewUpdate(title,channel)
            history.push(`/watch/${id}`)
        }}
        onMouseOver={()=>setHover(true)}
        onMouseOut={()=>setHover(false)}
        >
        <div className="RelatedVideoRow_video">
        {hover?<iframe
            className="RelatedVideoRow_image"
            frameborder="0" 
            style={{pointerEvents:"none"}}
            src={`${videoLink}?autoplay=1;&mute=1;&controls=0`}  
                // allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            ></iframe>:
            <iframe
            className="RelatedVideoRow_image"
            src={videoLink} 
            frameborder="0" 
            title="YouTube video player" 
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            
            ></iframe>}
        </div>    
        <div className="RelatedVideoRow_text">
        <h4 className="RelatedVideoRow_title">{title}</h4>
        <p>{channel}</p>
        <p>{views} views {date}</p>
        </div>
        </div>
    )
}



